/* CambriaMath font converted for jsPDF */
import { jsPDF } from "jspdf";

(function (jsPDFAPI) {
  var callAddFont = function () {
    this.addFileToVFS("CambriaMath.ttf", "");
    this.addFont("CambriaMath.ttf", "CambriaMath", "normal");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
